import React, { Component } from 'react'
import PropTypes from 'prop-types'
import styled from 'styled-components'

const Wrapper = styled.div``

export class ProductCard extends Component {
  static propTypes = {
    product: PropTypes.object.isRequired,
  }

  render() {
    const {
      props: { product },
    } = this
console.log(product)
    return (
      <Wrapper>
        <div className="product-card__content">
          {product.gallery.map((image) => {
            return <img src={image[0]} alt="" />
          })}
          <div className="product-card__content-text">
            <p className="product-card__content-text--name">{product.name}</p>
            {/* <p className='product-card__content-text--price'>{product.prices.currency.symbol}{product.prices.amount} </p> */}
          </div>
        </div>
      </Wrapper>
    )
  }
}

export default ProductCard
